import React from "react";
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  useNavigate,
  useLocation,
  Navigate,
  Outlet,
} from "react-router-dom";
import { AppBar } from "../common/components/app-bar/app-bar";
import { APP_ROUTES } from "../common/constants/app-bar.constans";

function App() {
  return (
    <div>
      <BrowserRouter>
        <AppBar />
        <Routes>
          {APP_ROUTES.map((route, index) => (<Route
            key={index}
            path={route.path}
            element={route.element}
          />))}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
